import React from 'react';
import { Container, Table, Card, Row, Col, Badge } from 'react-bootstrap';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';
import { 
  ComposedChart, 
  Line, 
  Cell, 
  ScatterChart, 
  Scatter,
  ReferenceLine
} from 'recharts';

const SimulationResults = ({ results }) => {
  if (!results) return null;

  // Prepare data for Gantt chart
  const ganttData = results.cloudletResults.map(cloudlet => ({
    id: cloudlet.cloudletId,
    vmId: cloudlet.vmId,
    startTime: cloudlet.startTime,
    finishTime: cloudlet.finishTime,
    executionTime: cloudlet.executionTime,
    cost: cloudlet.cost
  }));

  // Prepare data for VM utilization chart
  const vmUtilizationData = [];
  const vmMap = new Map();

  results.cloudletResults.forEach(cloudlet => {
    if (!vmMap.has(cloudlet.vmId)) {
      vmMap.set(cloudlet.vmId, {
        vmId: cloudlet.vmId,
        totalExecutionTime: cloudlet.executionTime,
        taskCount: 1
      });
    } else {
      const vmData = vmMap.get(cloudlet.vmId);
      vmData.totalExecutionTime += cloudlet.executionTime;
      vmData.taskCount += 1;
      vmMap.set(cloudlet.vmId, vmData);
    }
  });

  vmMap.forEach(value => {
    vmUtilizationData.push(value);
  });

  // Custom colors for charts
  const COLORS = ['#0088FE', '#00C49F', '#FFBB28', '#FF8042', '#8884d8', '#82ca9d'];

  // Calculate the maximum finish time for Gantt chart scaling
  const maxFinishTime = Math.max(...results.cloudletResults.map(c => c.finishTime));

  return (
    <Container className="mt-4 mb-5">
      <Card className="mb-4">
        <Card.Header as="h5">
          Simulation Results - {results.algorithm.replace(/_/g, ' ')}
        </Card.Header>
        <Card.Body>
          <Row className="mb-4">
            <Col md={4}>
              <Card className="text-center h-100">
                <Card.Body>
                  <Card.Title>Total Execution Time</Card.Title>
                  <h3>{results.totalExecutionTime.toFixed(2)} seconds</h3>
                </Card.Body>
              </Card>
            </Col>
            <Col md={4}>
              <Card className="text-center h-100">
                <Card.Body>
                  <Card.Title>Total Cost</Card.Title>
                  <h3>${results.totalCost.toFixed(2)}</h3>
                </Card.Body>
              </Card>
            </Col>
            <Col md={4}>
              <Card className="text-center h-100">
                <Card.Body>
                  <Card.Title>Cloudlets Processed</Card.Title>
                  <h3>{results.cloudletResults.length}</h3>
                </Card.Body>
              </Card>
            </Col>
          </Row>

          <h5 className="mt-4 mb-3">Cloudlet Execution Timeline (Gantt Chart)</h5>
          <div style={{ width: '100%', height: 400 }}>
            <ResponsiveContainer>
              <ComposedChart
                layout="vertical"
                data={ganttData}
                margin={{ top: 20, right: 30, left: 50, bottom: 20 }}
              >
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis type="number" domain={[0, maxFinishTime * 1.1]} label={{ value: 'Time (seconds)', position: 'insideBottom', offset: -10 }} />
                <YAxis dataKey="id" type="category" label={{ value: 'Cloudlet ID', angle: -90, position: 'insideLeft' }} />
                <Tooltip 
                  formatter={(value, name, props) => {
                    if (name === 'startTime') return [`Start: ${value.toFixed(2)}s`, name];
                    if (name === 'executionTime') return [`Duration: ${value.toFixed(2)}s`, name];
                    return [value, name];
                  }}
                  labelFormatter={(value) => `Cloudlet ${value} on VM ${ganttData.find(item => item.id === value)?.vmId}`}
                />
                <Legend />
                <Bar dataKey="executionTime" stackId="a" fill="#8884d8" barSize={20}>
                  {ganttData.map((entry, index) => (
                    <Cell key={`cell-${index}`} fill={COLORS[entry.vmId % COLORS.length]} />
                  ))}
                </Bar>
                <ReferenceLine x={0} stroke="#000" />
              </ComposedChart>
            </ResponsiveContainer>
          </div>

          <h5 className="mt-4 mb-3">VM Utilization</h5>
          <div style={{ width: '100%', height: 300 }}>
            <ResponsiveContainer>
              <BarChart
                data={vmUtilizationData}
                margin={{ top: 20, right: 30, left: 20, bottom: 5 }}
              >
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="vmId" label={{ value: 'VM ID', position: 'insideBottom', offset: -5 }} />
                <YAxis yAxisId="left" orientation="left" label={{ value: 'Execution Time (s)', angle: -90, position: 'insideLeft' }} />
                <YAxis yAxisId="right" orientation="right" label={{ value: 'Task Count', angle: 90, position: 'insideRight' }} />
                <Tooltip />
                <Legend />
                <Bar yAxisId="left" dataKey="totalExecutionTime" name="Total Execution Time" fill="#8884d8" />
                <Bar yAxisId="right" dataKey="taskCount" name="Number of Tasks" fill="#82ca9d" />
              </BarChart>
            </ResponsiveContainer>
          </div>

          <h5 className="mt-4 mb-3">Detailed Results</h5>
          <div className="table-responsive">
            <Table striped bordered hover>
              <thead>
                <tr>
                  <th>Cloudlet ID</th>
                  <th>VM ID</th>
                  <th>Start Time (s)</th>
                  <th>Finish Time (s)</th>
                  <th>Execution Time (s)</th>
                  <th>Status</th>
                  <th>Cost ($)</th>
                </tr>
              </thead>
              <tbody>
                {results.cloudletResults.map((cloudlet) => (
                  <tr key={cloudlet.cloudletId}>
                    <td>{cloudlet.cloudletId}</td>
                    <td>{cloudlet.vmId}</td>
                    <td>{cloudlet.startTime.toFixed(2)}</td>
                    <td>{cloudlet.finishTime.toFixed(2)}</td>
                    <td>{cloudlet.executionTime.toFixed(2)}</td>
                    <td>
                      <Badge bg={cloudlet.status === 'SUCCESS' ? 'success' : 'danger'}>
                        {cloudlet.status}
                      </Badge>
                    </td>
                    <td>${cloudlet.cost.toFixed(2)}</td>
                  </tr>
                ))}
              </tbody>
            </Table>
          </div>
        </Card.Body>
      </Card>
    </Container>
  );
};

export default SimulationResults;
